import React from "react";

const About = () => {
    return (
        <div className={"relative text-gray-300 px-20 py-10"}>
            <h1 className={""}>About me</h1>
            <p>Hi there! I am a software developer from Sydney, Nova Scotia and program
                primarily in C/C++, Python, Lua, and can take any other language you throw at me.
                You can view some of the projects I have worked on either on my <a href={"https://github.com/emd22"}>Github page</a>, or
                in the <a href={"/projects"}>Projects</a> section of this website.</p>
            <br/>
            <p>&emsp;Early on, I started programming when I was first entering Grade 5 in Python, and was immediately hooked when
            I found out what I could make in Pygame. Since then, i've made kernels, text editors, terminal libraries, networking libraries,
            games, and much more. Me and my brother Andrew(@ajmd17) have also participated in a few code jams, including making an interpreted
            language(and a few examples in it!) named <a>Peach</a>, and an online game about fighting off <i>shitcoins</i>.
            </p>
        </div>
    );
}
export default About;
